import React, { useState, useEffect } from 'react';

function formatDate(date) {
  return date.toISOString().split('T')[0];
}

export default function BookingForm() {
  const params = new URLSearchParams(window.location.search);

  // Initialize form state with UTM defaults
  const today = new Date();
  const inTen = new Date(today);
  inTen.setDate(today.getDate() + 10);

  const [form, setForm] = useState({
    firstName: params.get('utm_firstName') || '',
    surname: params.get('utm_surname') || '',
    phone: params.get('utm_phone') || '',
    email: params.get('utm_email') || '',
    address: params.get('utm_address') || '',
    postcode: params.get('utm_postcode') || '',
    earliestDate: params.get('utm_earliestDate') || formatDate(today),
    latestDate: params.get('utm_latestDate') || formatDate(inTen)
  });

  const [slots, setSlots] = useState([]);
  const [dates, setDates] = useState([]);
  const [times, setTimes] = useState([]);
  const [selectedDate, setSelectedDate] = useState('');
  const [selectedTime, setSelectedTime] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Handle input changes
  const handleChange = e => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
  };

  // Fetch slots
  const fetchSlots = async () => {
    setLoading(true);
    setError(null);
    try {
      const res = await fetch(
        `${process.env.REACT_APP_API_BASE_URL}/api/available-slots`,
        {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({
            clientId: form.firstName + '_' + form.surname,  // example dynamic clientId
            clientRef: form.email,
            visitType: 'Service',
            postcode: form.postcode,
            earliestDate: form.earliestDate,
            latestDate: form.latestDate
          })
        }
      );
      if (!res.ok) throw new Error(`HTTP ${res.status}`);
      const { slots: fetched = [] } = await res.json();
      setSlots(fetched);

      // Extract unique dates
      const uniqueDates = Array.from(new Set(fetched.map(s => s.visitDate)));
      setDates(uniqueDates);
      setSelectedDate('');
      setTimes([]);
      setSelectedTime('');
    } catch (e) {
      setError(e.message);
    } finally {
      setLoading(false);
    }
  };

  // When date changes, compute times
  useEffect(() => {
    if (selectedDate) {
      const availableTimes = slots
        .filter(s => s.visitDate === selectedDate)
        .map(s => `${s.windowStart}â€“${s.windowEnd}`);
      setTimes(availableTimes);
      setSelectedTime('');
    }
  }, [selectedDate, slots]);

  return (
    <div>
      <h2>Booking Form</h2>
      <form onSubmit={e => { e.preventDefault(); fetchSlots(); }}>
        {[
          { label: 'First Name', name: 'firstName', type: 'text' },
          { label: 'Surname',    name: 'surname',    type: 'text' },
          { label: 'Phone',      name: 'phone',      type: 'tel' },
          { label: 'Email',      name: 'email',      type: 'email' },
          { label: 'Address',    name: 'address',    type: 'text' },
          { label: 'Postcode',   name: 'postcode',   type: 'text' }
        ].map(field => (
          <div key={field.name} style={{ margin: '0.5rem 0' }}>
            <label>{field.label}: </label>
            <input
              type={field.type}
              name={field.name}
              value={form[field.name]}
              onChange={handleChange}
              required
            />
          </div>
        ))}
        <div style={{ margin: '0.5rem 0' }}>
          <label>Earliest Date: </label>
          <input
            type="date"
            name="earliestDate"
            value={form.earliestDate}
            onChange={handleChange}
            required
          />
        </div>
        <div style={{ margin: '0.5rem 0' }}>
          <label>Latest Date: </label>
          <input
            type="date"
            name="latestDate"
            value={form.latestDate}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit" disabled={loading}>
          {loading ? 'Loading...' : 'Get Available Dates'}
        </button>
      </form>

      {error && <p style={{ color: 'red' }}>{error}</p>}

      {dates.length > 0 && (
        <div style={{ marginTop: '1rem' }}>
          <label>
            Select Date: {' '}
            <select
              value={selectedDate}
              onChange={e => setSelectedDate(e.target.value)}
            >
              <option value="">--Choose a date--</option>
              {dates.map(d => (<option key={d} value={d}>{d}</option>))}
            </select>
          </label>
        </div>
      )}

      {times.length > 0 && (
        <div style={{ marginTop: '1rem' }}>
          <label>
            Select Time: {' '}
            <select
              value={selectedTime}
              onChange={e => setSelectedTime(e.target.value)}
            >
              <option value="">--Choose a time--</option>
              {times.map(t => (<option key={t} value={t}>{t}</option>))}
            </select>
          </label>
        </div>
      )}

      {selectedDate && selectedTime && (
        <p style={{ marginTop: '1rem' }}>
          You selected: {selectedDate}, {selectedTime}
        </p>
      )}
    </div>
  );
}
